func TestGetAmountsForLiqLive(t *testing.T) {
	for i, test := range getAmountsForLiqLiveTestTable {
		i := i
		test := test
		t.Run(strconv.Itoa(i), func(t *testing.T) {
			t.Parallel()
			curPrice, err := new(big.Int).SetString(test.curPrice, 10)
			assert.Truef(t, err, "bad current price, %v", i)
			lowerPrice, err := new(big.Int).SetString(test.lowerPrice, 10)
			assert.Truef(t, err, "bad lower price, %v", i)
			upperPrice, err := new(big.Int).SetString(test.upperPrice, 10)
			assert.Truef(t, err, "bad upper price, %v", i)
			delta, err := new(big.Int).SetString(test.delta, 10)
			assert.Truef(t, err, "bad delta, %v", i)
			expectedAmt0, err := new(big.Rat).SetString(test.expectedAmount0)
			assert.Truef(t, err, "bad expected amount0, %v", i)
			expectedAmt1, err := new(big.Rat).SetString(test.expectedAmount1)
			assert.Truef(t, err, "bad expected amount1, %v", i)
			amount0, amount1 := GetAmountsForLiq(curPrice, lowerPrice, upperPrice, delta)
			assertOneDiff(t, expectedAmt0, amount0, "amount0 incorrect")
			assertOneDiff(t, expectedAmt1, amount1, "amount1 incorrect")
		})
	}
}

