func TestGetIndividualAmountsForLiquidity(t *testing.T) {
	for i, test := range getIndividualAmountsForLiquidityTestTable {
		i := i
		test := test
		t.Run(strconv.Itoa(i), func(t *testing.T) {
			t.Parallel()
			sqrtRatioAX96, ok := new(big.Int).SetString(test.sqrtRatioAX96, 10)
			assert.Truef(t, ok, "bad sqrtRatioAX96: %v", i)
			sqrtRatioBX96, ok := new(big.Int).SetString(test.sqrtRatioBX96, 10)
			assert.Truef(t, ok, "bad sqrtRatioBX96: %v", i)
			liq, ok := new(big.Int).SetString(test.liq, 10)
			assert.Truef(t, ok, "bad liq: %v", i)
			expected, ok := new(big.Rat).SetString(test.expected)
			assert.Truef(t, ok, "expected: %v", i)
			switch test.side {
			case 0:
				amount0 := GetAmount0ForLiq(sqrtRatioAX96, sqrtRatioBX96, liq)
				assertOneDiff(t, expected, amount0, "amount0 not equal")
			case 1:
				amount1 := GetAmount1ForLiq(sqrtRatioAX96, sqrtRatioBX96, liq)
				assertOneDiff(t, expected, amount1, "amount1 not equal")
			default:
				t.Fatalf("weird test, count %v", i)
			}
		})
	}
}

func assertOneDiff(t *testing.T, x, y *big.Rat, reason string, fmt ...any) {
	z := new(big.Rat).Sub(x, y)
	//if abs(z) > 0
	if z.Abs(z).Cmp(OneRat) > 0 {
		assert.Equalf(t, x.FloatString(0), y.FloatString(0), reason, fmt...)
	}
}
